import React from 'react';
import ReactDOM from 'react-dom';

import {add,mult,div,sub} from "./Calci"

ReactDOM.render(<>
<ol>
    <li>{add(20,20)}</li>
    <li>{mult(12,12)}</li>
    <li>{div(26,13)}</li>
    <li>{sub(20,5)}</li>
</ol>
</>,document.getElementById("root"));

